Defendant Andrew Donovan Hosler in court with attorney Lauren Stuckert.  Irene Elizabeth Parthum appeared for the State of Wisconsin.

Matter here for a Plea/Sentencing.  As to Plea:  Defendant was advised of constitutional rights and maximum penalties, waived all rights, and plead GUILTY.  Defendant examined as to the plea.  Plea Questionnaire/Waiver of Rights, Addendum, and Jury Instructions received and filed.  Stipulation by parties to the Criminal Complaint as a factual basis to sustain the plea.  Court found the defendant guilty.  Judgment of conviction entered.
  
Court advised defendant that as a convicted felon he may never possess any gun or other firearms. 
Court advised defendant that his voting rights are suspended, and may not vote in any election until his civil rights are restored.  

Court advised defendant if he is not a citizen of the United States of America, that upon a plea of guilty or no contest for this offense, he could be deported, excluded from admission to his country, or denied naturalization under federal law.  
Court advised that the defendant will have to provide a DNA sample, to the Wisconsin State Crime Laboratory for DNA testing and pay a DNA surcharge.

Sentencing proceeded.  Statements by the State, defense and defendant.    The Court imposed the following sentence:   
The Defendant's TOTAL LENGTH OF SENTENCE shall be SIX (6) YEARS.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for THREE (3) years with credit for THIRTEEN (13) days time served.  Defendant shall serve THREE (3) years on EXTENDED SUPERVISION.  The Court STAYS sentence and orders PROBATION for THREE (3) YEARS.

The Court advised the defendant of the determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 

CONDITIONS OF PROBATION:
 - No controlled substances or alcohol at all;
 - AODA assessment; treatment, if needed;
 - Urine screens to ensure compliance;
 - Practice Absolute Sobriety;
 - Seek and maintain employment;
 - Interlock for THIRTY-SIX (36) months;
 - No driving of any automobile at all;
 - Operating Priviliges Suspended for THIRTY-SIX (36) months;
 - Restitution set at ZERO;
 - Pay fine in the amount of $600;
 - When release, no electronic monitoring at all;
 - Eleven (11) months in Jail w/Huber.  No more than sixty (60) hours a week for work AND treatment;
 - The Court Ordered that all fines, surcharges and costs and disbursements are to be taken out of bail amount that was posted.   
 - Pay the DNA surcharge, costs and disbursements by the end of probationary period.  Should defendant get revoked and be sent to prison, Court ordered monies taken by the Department of Correction from up to 25% of prison funds.

If revoked, the defendant is not eligible for the Challenge Incarceration Program or the Wisconsin Substance Abuse Program.  

Court ordered defendant REMANDED into the custody of the Milwaukee County Sheriff's Department.

